import React from 'react';
import logo from './logo.svg';
import { Map, GoogleApiWrapper } from 'google-maps-react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
        <Map
          google={this.props.google}
          zoom={8}
          style={mapStyles}
          initialCenter={{ lat: 47.444, lng: -122.176}}
        />    )
  }
}

export default App;
